import Button from "../components/Button";

const AddTodo = () =>{
    return (
        <div>
            <input type="text" placeholder="Введите текс и нажмите Добавить"/>
            <Button text = "Добавить Todo" className = "add_todo"/>
        </div>

    )
}

export default AddTodo;
